import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card using text selector (first product title)
    await page.waitForSelector('text="Apple iPhone 15 Pro Max"', { timeout: 5000 });

    // Find all "Add to Cart" buttons using their text and class
    const addToCartButtons = await page.$$('button.add-to-cart');

    // Rapidly click the first 3 "Add to Cart" buttons 5 times each
    for (let i = 0; i < Math.min(3, addToCartButtons.length); i++) {
      for (let j = 0; j < 5; j++) {
        await addToCartButtons[i].click();
      }
    }

    // Take screenshot after rapid add-to-cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_adds.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_adds.png'));

    // Open the cart: use XPath to find the cart div by text content
    const cartDiv = await page.waitForSelector('//div[contains(normalize-space(.), "Cart")]', { timeout: 5000 });
    await cartDiv.click();

    // Wait for cart modal or content to appear (look for cart items or "Your cart is empty")
    await page.waitForSelector('.cart-item, .empty-cart', { timeout: 5000 });

    // Take screenshot of cart view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // Try to increment quantity of the first cart item rapidly
    const plusButtons = await page.$$('.cart-item .quantity-btn');
    // The "+" button is the second button in each .cart-item .quantity-btn pair
    for (let i = 1; i < plusButtons.length; i += 2) {
      for (let j = 0; j < 3; j++) {
        await plusButtons[i].click();
      }
    }

    // Take screenshot after quantity increments
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_incremented.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_incremented.png'));

    // Remove the first cart item using the "Remove" button (by button text)
    const removeBtn = await page.$('button:has-text("Remove")');
    if (removeBtn) {
      await removeBtn.click();
    }

    // Take screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_after_remove.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_after_remove.png'));

    // Extract the cart total value (if present)
    let cartTotal = null;
    try {
      const cartTotalEl = await page.$('#cartTotal');
      if (cartTotalEl) {
        cartTotal = await cartTotalEl.textContent();
      }
    } catch {}

    // Extract the number of items in cart counter (by ID or text)
    let cartCount = null;
    try {
      const cartCountEl = await page.$('#cartCount');
      if (cartCountEl) {
        cartCount = await cartCountEl.textContent();
      }
    } catch {}

    return {
      success: true,
      action: "Performed rapid cart add, quantity increment, and removal stress test with screenshots.",
      extractedData: {
        cartTotal,
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
